import React from 'react';
import { useSelector } from 'react-redux/es/exports';
import { getAllListUser } from '../../features/users/usersSlice';
import UserCard from '../UserCard/UserCard';
import './UserListing.scss';
const UserListAll = () => {
    const userslist = useSelector(getAllListUser);
    let renderUsersList = "";
    //console.log(users.data);
    renderUsersList = userslist.length > 0 ? (
        //console.log("hay datos")
        userslist.map((post, index)=>{
            // console.log("array mapeado: ",post);
            return <UserCard key={index} data={post} />             
        })
    ) : (<div className="users-error"><h3> Error </h3></div>);
    return (
        <div className="user-wrapper">
            <div className="user-list">
                <h2>Users</h2>
                <div className="user-container">
                    {renderUsersList}                    
                </div>
            </div>
        </div>
    );
};

export default UserListAll;
